static ANTLR3_INT32 dfa3_sst(pVmdParser ctx, pANTLR3_BASE_RECOGNIZER recognizer, pANTLR3_INT_STREAM is, pANTLR3_CYCLIC_DFA dfa, ANTLR3_INT32 s)
{
    ANTLR3_INT32    _s;
    
    _s	    = s;
    switch  (s)
    {
        case 0:
        
    	{
    	    ANTLR3_UINT32 LA3_1;

    	    ANTLR3_MARKER index3_1;


    		LA3_1 = LA(1);

    	 
    	    index3_1 = INDEX();

    	    REWINDLAST();

    	    s = -1;
    	    if ( (synpred3_Vmd(ctx)) )
    	    {
    	        s = 10;
    	    }

    	    else if ( (synpred10_Vmd(ctx)) )
    	    {
    	        s = 8;
    	    }

    	 
    		SEEK(index3_1);

    	    if ( s>=0 ) 
    	    {
    		return s;
    	    }
    	}
    	break;
        case 1:
        
    	{
    	    ANTLR3_UINT32 LA3_9;

    	    ANTLR3_MARKER index3_9;


    		LA3_9 = LA(1);

    	 
    	    index3_9 = INDEX();

    	    REWINDLAST();

    	    s = -1;
    	    if ( (synpred10_Vmd(ctx)) )
    	    {
    	        s = 8;
    	    }

    	    else if ( (ANTLR3_TRUE) )
    	    {
    	        s = 11;
    	    }

    	 
    		SEEK(index3_9);

    	    if ( s>=0 ) 
    	    {
    		return s;
    	    }
    	}
    	break;
    }
    if (BACKTRACKING > 0)
    {
	FAILEDFLAG = ANTLR3_TRUE;
	return	-1;
    }    
    CONSTRUCTEX();
    EXCEPTION->type         = ANTLR3_NO_VIABLE_ALT_EXCEPTION;
    EXCEPTION->message      = (void *)"65:1: selection : ( '(' orSelection ')' -> orSelection | NOT selection -> ^( NOT selection ) | SAME LIT AS orSelection -> ^( SAME LIT orSelection ) | WITHIN LIT OF orSelection -> ^( WITHIN LIT orSelection ) | EXWITHIN LIT OF orSelection -> ^( EXWITHIN LIT orSelection ) | PBWITHIN LIT OF orSelection -> ^( PBWITHIN LIT orSelection ) | WITHINBONDS LIT OF orSelection -> ^( WITHINBONDS LIT orSelection ) | (a= addExpr -> $a) relOp (b= addExpr -> $b) -> ^( RELATION relOp $a $b) | LIT literals -> ^( KEYWORD LIT literals ) );";
    EXCEPTION->decisionNum  = 3;
    EXCEPTION->state        = _s;
    return -1;
}

